import React, { Component, Fragment } from 'react';
import DeskTopLayout from '../../components/layouts/deskTopLayout';
import MobileLayout from '../../components/layouts/MobileLayout';
import SectionTitle from '../../components/includes/SectionTitle';
import Header from '../../components/includes/Header';
import OutlineBtn from '../../components/OutlineBtn';
import withSizes from 'react-sizes';
import css from '../../styles/main.scss';

const Baccarat = ({ isMobile, isTablet, isDesktop }) => {
  return (
    <Fragment>
      <DeskTopLayout>
        <div className="container">
          <div
            className={css.gameCard}
            style={{
              backgroundImage:
                'linear-gradient(180deg, rgba(0,0,0,0.00) 50%, #000000 85%),url(images/beauty/baccarat01.png),url(images/background/baccarat01.png)'
            }}
          >
            <span className="iconfont icon_allbet" />
            <OutlineBtn />
            <style jsx>
              {`
                span {
                  color: white;
                  background-image: linear-gradient(
                    to bottom,
                    #ff4e50 0%,
                    #f9d423 51%,
                    #ff4e50 100%
                  );
                  -webkit-background-clip: text;
                  -webkit-text-fill-color: transparent;
                  font-size: 7rem;
                  line-height: 60px;
                  text-shadow: 0 1px 2px rgba(0, 0, 0, 1);
                  margin-bottom: 8px;
                }
              `}
            </style>
          </div>
        </div>
      </DeskTopLayout>
      {isMobile && (
        <MobileLayout>
          <div className={css.mobileEmpty} />
          <h1>mobile layout</h1>
        </MobileLayout>
      )}
    </Fragment>
  );
};

const mapSizesToProps = ({ width }) => ({
  isTablet: width >= 480 && width < 1024,
  isDesktop: width >= 1024,
  isMobile: width <= 480
});
export default withSizes(mapSizesToProps)(Baccarat);
